    class Element:
        def __init__(self, value, list_num, index):
            self.value = value
            self.list_num = list_num
            self.index = index

        def __lt__(self, other):
            return self.value < other.value

    min_heap = []
    current_max = float('-inf')

    for i, arr in enumerate(arrays):
        heapq.heappush(min_heap, Element(arr[0], i, 0))
        current_max = max(current_max, arr[0])

    range_start, range_end = 0, float('inf')

    while len(min_heap) == len(arrays):
        current_min_element = heapq.heappop(min_heap)
        current_min = current_min_element.value

        if current_max - current_min < range_end - range_start:
