def find_kth(arr1, arr2, m, n, k):
    i = j = 0
    while k > 0:
        # When one array is entirely consumed.
        if i == m:
            return arr2[j + k - 1]
        if j == n:
            return arr1[i + k - 1]

        # If k == 1, return minimum of the two current elements.
        if k == 1:
            return min(arr1[i], arr2[j])

        # Compare the k // 2th elements of arr1 and arr2.
        mid1 = float('inf') if (i + k // 2 - 1) >= m else arr1[i + k // 2 - 1]
        mid2 = float('inf') if (j + k // 2 - 1) >= n else arr2[j + k // 2 - 1]

        # Discard half of one array's elements.
        if mid1 < mid2:
            i += k // 2
        else:
            j += k // 2
        k -= k // 2

    return arr1[i] if arr1[i] < arr2[j] else arr2[j]

