    num = 1
    layer = 0
    while num <= n*n:
        for i in range(layer, n-layer):
            matrix[layer][i] = num
            num += 1
        for i in range(layer+1, n-layer):
            matrix[i][n-layer-1] = num
            num += 1
        for i in range(n-layer-2, layer-1, -1):
